import styled from 'styled-components';


let StyledContainer = styled.div`
background-color:
width:500px;
margin:0 auto;
display:flex;
justify-content:center;
flex-direction:column;
align-items:center;
`;
let StyledButton = styled.button`
width:70%;
height:35px;
margin:3px 0px;
font-family:-apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
font-weight:bold;
border-radius:10px;
border:2px solid black;
cursor: pointer;
background-color:#ffffff;
outline:none;
&:hover{
        background: rgba(255,255,255,.8);
        color: black;
     }
`
let StyledTitle = styled.h1`
font-size:25px;
color:white;
margin:5px 0px;
`

const SignUpPopup = () => {
    return (
        <StyledContainer>
            <StyledTitle>Save time</StyledTitle>
            <StyledContainer>
                <StyledButton>Signup with Facebook</StyledButton>
                <StyledButton>Signup with Gmail</StyledButton>
                <StyledButton>Signup with Apple</StyledButton>
            </StyledContainer>
            <StyledTitle>Sign up regularly</StyledTitle>
            <StyledButton>Signup with Email</StyledButton>
        </StyledContainer>
    )
}
export default SignUpPopup;
